import React from "react";
import "./App.css";
import MemsList from "./data/MemsList.json";
import Grid from "@material-ui/core/Grid";
import TextField from "@material-ui/core/TextField";
import Mem from './component/Mem';

function App() {
  return (
    <div className="App">
      <TextField style={{ padding: 24 }} />
      <Grid container spacing={24} style={{ padding: 24 }} />
      <h1>Wszystkieee memy !</h1>
      {MemsList.map(memsDetail => (
        <Mem key={memsDetail.id} title={memsDetail.title} img={memsDetail.img}/>
      ))}
    </div>
  );
}

export default App;
